func main() {
	// 大文件读写
	f1, err := os.Open("./1.wmv")
	if err != nil {
		panic(err)
	}
	defer f1.Close()
	fnew, err := os.Create("./new.wmv")
	if err != nil {
		panic(err)
	}
	defer fnew.Close()
	t := time.Now()
	reader := bufio.NewReader(f1)
	writer := bufio.NewWriter(fnew)
	buf := make([]byte, 100)
	for {
		n, err := reader.Read(buf)
		if err != nil && err != io.EOF {
			// fmt.Println("Read:", err)
			break
		}
		// fmt.Println("Read n:", n)

		_, err2 := writer.Write(buf[0:n])
		if err2 != nil {
			// fmt.Println("writer:", err)
			break
		}
		// fmt.Println("writer n2:", n2)
		if err == io.EOF || n < 10 {
			//读完了
			fmt.Println("读完了1")
			break
		}
	}
	elapsed := time.Since(t)
	fmt.Println("app elapsed:", elapsed)
	// io.Copy(fnew, f1)
}

func file2base64() {
	content, err := ioutil.ReadFile("./golang.jpg")
	if err != nil {
		panic(err)
	}
	imgcontent := base64.StdEncoding.EncodeToString(content)

	fmt.Println(len(string(imgcontent)))
	fmt.Println(len(string(imgbase64)))
}

func base64Toimage() {
	imgcontent, err := base64.StdEncoding.DecodeString(imgbase64)
	if err != nil {
		panic(err)
	}
	reader := bytes.NewReader(imgcontent)
	cfg, str, err := image.DecodeConfig(reader)
	if err != nil {
		panic(err)
	}
	fmt.Printf("cfg:%+v", cfg)
	fmt.Println(str)
}

func file2Image() {
	f1, err := os.Open("./golang.jpg")
	if err != nil {
		panic(err)
	}
	defer f1.Close()
	cfg, str, err := image.DecodeConfig(f1)
	if err != nil {
		panic(err)
	}
	fmt.Printf("cfg:%+v", cfg)
	fmt.Println(str)
}

// []byte转reader
func Base64Tofile() {
	// []byte转reader
	imgcontent, err := base64.StdEncoding.DecodeString(imgbase64)
	if err != nil {
		panic(err)
	}
	fnew, err := os.Create("./new.jpg")
	if err != nil {
		panic(err)
	}
	defer fnew.Close()
	reader := bytes.NewReader(imgcontent)
	io.Copy(fnew, reader)
}
func RWfile() {
	f1, err := os.Open("./golang.jpg")
	if err != nil {
		panic(err)
	}
	defer f1.Close()
	fnew, err := os.Create("./new.jpg")
	if err != nil {
		panic(err)
	}
	defer fnew.Close()
	io.Copy(fnew, f1)
}

